/**
 * list.js
 * Created by zyc on 17/7/21.
 */
import Vue from 'vue';
import { Button, Form, FormItem, upload, Message, DatePicker, Input } from 'element-ui';
import verify from './verify.vue';

Vue.use(Button);
Vue.use(Form);
Vue.use(FormItem);
Vue.use(upload);
Vue.use(Input);
Vue.use(DatePicker);

Vue.prototype.$message = Message;

Vue.config.productionTip = false;

/* eslint-disable no-new */
/* eslint-disable no-unused-vars */
const vm = new Vue({
  el: '#app',
  template: '<verify />',
  components: { verify }
});
window.rns = {};
